obierno Regional de Coquimbo, según se detalla en la propuesta adjunta, por un monto total de M$13.267.758 para el año 2022, para cumplir con el acuerdo GORE de Coquimbo.',NULL,NULL,19,NULL,NULL,NULL,NULL,'2022-01-11',NULL,NULL,'Solo Excel',NULL,NULL,'2022-12-30 23:53:26','OF19DA_FETCovid19','http://dirplancolabora.mop.gov.cl/presu/Decretos/2022/OF19DA_FETCovid19.pdf'),(12,18,'2022-01-14','Decreto',2022,'Decreto Inicial Nuevos, se identifican 9 proyectos entre los que destaca \"CONSERVACION MAYOR AREA DE MOVIMIENTO AERODROMO DE CALDERA\", se genera compromisos para el año 2023 por M$1.293.726.',NULL,NULL,27,NULL,1014,'2022-01-03','2022-01-28','2022-01-14',NULL,'2022-01-28','Excel y SAFI',NULL,447743,'2022-12-30 23:53:26','DEC27DAP','http://dirplancolabora.mop.gov.cl/presu/Decretos/2022/DEC27DAP.pdf'),(13,233,'2022-05-25','Oficio_Solicitud',2022,'La Dirección de Planeamiento solicita la asignación de recursos adicionales en Subtítulo 29, ítem 03 \"Vehículos\" por M$40.000; ítem 04 \"Mobiliario\" M$5.680;  ítem 05 \"Máquinas y Equipos\" M$5.532; ítem 06 \"Equipos Informáticos\" M$98.030 e ítem 07 \"Programas Informáticos\" por M$5.0000. El presupuesto requerido será financiado con un traspaso de fondos desde el Subtítulo 30 de otros Servicios MOP.\nAdemás solicita recursos por M$325.000, en el ST 22.11.001 para 4 estudios \"Diseño Plan Director de Infraestructura para el 2055\", \"Elaboración Metodología de Formulación y Evaluación de Proyectos de Infraestructura Verde y Soluciones Basadas en la Naturaleza\", \"Libro Blanco de la Descentralización del MOP\" y \"Libro Blanco del Enfoque de Género del MOP\".\n',NULL,NULL,27,NULL,NULL,NULL,NULL,'2022-01-17',NULL,NULL,'Solo Excel',NULL,NULL,'2022-12-30 23:53:26','OF27DP','http://dirplancolabora.mop.gov.cl/presu/Decretos/2022/OF27DP.pdf'),(14,232,'2022-05-25','Oficio_Solicitud',2022,'La Dirección de Planeamiento solicita la asignación de recursos en Subtítulo 31, para el Estudio Básico denominado “Diagnóstico Plan de Inversión Servicios Sanitarios Rurales Macrozona Norte”, por un monto M$32.143 para el año 2022 y M$181.013 para el año 2023. El presupuesto requerido será financiado con un traspaso de fondos sin Decretar desde el Subtítulo 31 de la Dirección de Vialidad.\nAdemás solicita identificar el estudio \"Análisis Plan de Inversión en Soluciones de Reuso 12 Localidades Rurales\" por el monto de M$30.000 para el año 2022 y M$125.131 para el año 2023.',2,NULL,28,NULL,NULL,NULL,NULL,'2022-01-17',NULL,NULL,'Solo Excel',NULL,NULL,'2022-12-30 23:53:26','OF28DP-DV','http://dirplancolabora.mop.gov.cl/presu/Decretos/2022/OF28DP-DV.pdf'),(15,7,'2022-01-14','Proposicion',2022,'Se solicita identificar 5 iniciativas por un monto total de M$3.669.133. Esta cartera incluye 1 proyecto que\nforma parte de la Nómina de Respaldo de la Ley de Presupuestos 2022 y los restantes corresponden a\nproyectos iniciados en el año 2021. Destacan en la proposición, la “Ampliación Edificio MOP Atacama” y la\n“Normalización Edificio de los SSPP y Provinciales MOP XII Región”.',5,NULL,29,NULL,NULL,NULL,NULL,'2022-01-18','0211',NULL,'Solo Excel',NULL,NULL,'2022-12-30 23:53:26','SOL29DA_FETCovid19','http://dirplancolabora.mop.gov.cl/presu/Decretos/2022/SOL29DA_FETCovid19.pdf'),(16,11,'2022-01-14','Decreto',2022,'Se decretan 6 iniciativas de la cartera regular DGA por M$1.466.336 para el año 2022 y compromisos por M$502.000 para el 2023.-',NULL,NULL,29,NULL,1051,'2022-01-03','2022-01-28','2022-01-19',NULL,'2022-01-28','Excel y SAFI',NULL,447716,'2022-12-30 23:53:26','DEC29DGA','http://dirplancolabora.mop.gov.cl/presu/Decretos/2022/DEC29DGA.pdf'),(17,71,'2022-01-14','Proposicion',2022,'Se solicita identificar 5 iniciativas por un monto total de M$3.669.133. Esta cartera incluye 1 proyecto que\nforma parte de la Nómina de Respaldo de la Ley de Presupuestos 2022 y los restantes corresponden a\nproyectos iniciados en el año 2021. Destacan en la proposición, la “Ampliación Edificio MOP Atacama” y la\n“Normalización Edif