sicion',2022,'Vialidad solicita modificación para el presente año en el subtítulo 21, “Gasto en Personal”,  correspondiente a un aumento de la Glosa autorizada y recursos para viáticos en territorio nacional, la cual se requiere para poder dar cobertura al pago por este concepto, derivado de las labores de continuidad operacional en terreno y que permitan efectuar un adecuado apoyo a la inspección de programa de inversiones.\nDado lo anterior, se solicita aumento en el ST 21 “Gastos en Personal” y aumento adicional a la Glosa de viáticos en territorio nacional, por un total de M$ 1.700.000, para su financiamiento se proponen 2 alternativas:\nAlternativa 1:\n Incremento del ST 21 “Gastos en Personal” por M$ 1.700.000\n Incremento Glosa N° 3 c) Autorización máxima para gastos en viáticos por M$ 1.700.000\nPara su financiamiento, se dispone de los siguientes recursos:\n M$ 1.300.000 del ST 21 “Gastos en Personal” de la Dirección de Vialidad FET – Covid19\n M$ 1.100.000 del ST 21 “Gastos en Personal” de Agua Potable Rural\nAlternativa 2:\nSolicitud de autorización para ejecución de gastos en viáticos con fondos propios del Servicio, a través del ST 31 para funcionarias/os que desarrollan labores de Administración Directa',NULL,NULL,548,NULL,NULL,NULL,NULL,'2022-08-17','0213',NULL,'Solo Excel',NULL,NULL,'2022-12-30 23:53:26','SOL548DV-APR','http://dirplancolabora.mop.gov.cl/presu/Decretos/2022/SOL548DV-APR.pdf'),(552,381,'2022-08-12','Oficio_Solicitud',2022,' Se solicita ajuste presupuestario para incrementar el Subtítulo 22 “Bienes y Servicios de Consumo” de la Dirección de Planeamiento, por el monto de M$25.000, a través de una reasignación del ST 21, para desarrollar el estudio inherente denominado “Diseño Plan Director de Infraestructura para el 2055”.',NULL,NULL,548,NULL,NULL,NULL,NULL,'2022-08-12',NULL,NULL,'Solo Excel',NULL,NULL,'2022-12-30 23:53:26','OF548DP','http://dirplancolabora.mop.gov.cl/presu/Decretos/2022/OF548DP.pdf'),(553,351,'2022-08-17','Proposici