s regiones.',31,NULL,702,NULL,NULL,NULL,NULL,'2022-10-05','0211',NULL,'Solo Excel',NULL,NULL,'2022-12-30 23:53:26','SOL702APR','http://dirplancolabora.mop.gov.cl/presu/Decretos/2022/SOL702APR.pdf'),(741,418,'2022-10-05','Proposicion',2022,'Se solicita modificar 4 proyectos en las regiones de Valparaíso, Maule y La Araucanía.',4,NULL,703,NULL,NULL,NULL,NULL,'2022-10-06','0211',NULL,'Solo Excel',NULL,NULL,'2022-12-30 23:53:26','SOL703DOH_FETCovid19','http://dirplancolabora.mop.gov.cl/presu/Decretos/2022/SOL703DOH_FETCovid19.pdf'),(742,528,'2022-11-02','Proposicion',2022,'Se solicita autorización para viaje del Subsecretario de Obras Públicas, entre los días 4 al 15 de noviembre, relacionado con visitas de inspección técnica de fábricas y maestranzas que elaboran los sistemas de apoyo\ny sillas del Puente Chacao',NULL,NULL,704,NULL,NULL,NULL,NULL,'2022-11-02','0213',NULL,'Solo Excel',NULL,NULL,'2022-12-30 23:53:26','SOL704SOP','http://dirplancolabora.mop.gov.cl/presu/Decretos/2022/SOL704SOP.pdf'),(743,289,'2022-06-29','Oficio_Solicitud',2022,'Se solicita identificar recursos en el Subtítulo 31, para el proyecto “Restauración Palacio Pereira y Reposición Edificios Consejo Monumentos Nacionales y DIBAM”, por un monto total de M$154.000 para el año 2022, para pagar indemnización por mayores gastos a la empresa contratista. No se comprometen recursos para años siguientes. \n\nEsta propuesta se financia con fondos sin Decretar del Servicio.\n',1,NULL,705,NULL,NULL,NULL,NULL,'2022-06-30',NULL,NULL,'Solo Excel',NULL,NULL,'2022-12-30 23:53:26','OF705DA','http://dirplancolabora.mop.gov.cl/presu/Decretos/2022/OF705DA.pdf'),(744,81,'2022-05-18','Decreto',2022,'Concesiones solicita modificar y asignar presupuesto por  M$65.653, para el presente año destinado a Asesoría de Inspección Fiscal de la obra pública fiscal denominado “Hospital de La Serena”.\nEn materia de compromisos futuros se solicitan M$ 1.286.607 para el año 2023, M$ 1.344.759 para el año 2024, M$ 1.419.531 para el año 2025 y M$ 1.379.358 para el año 2026.',NULL,NULL,706,NULL,233,'2022-04-26','2022-06-02',NULL,NULL,'2022-06-02','Solo Excel',NULL,453953,'2022-12-30 23:53:26','DEC706DGC','http://dirplancolabora.mop.gov.cl/presu/Decretos/2022/DEC706DGC.pdf'),(745,84,'2022-05-18','Decreto',2022,'Se ajustan recursos correspondientes a la inspección fiscal de 3 proyectos, por  M$65.653, destinado a Asesoría de Inspección Fiscal de la obra pública fiscal denominado “Hospital de La Serena”, se decretan M$ 1.133.776 para el año 2023, M$ 1.187.340 para el año 2024, M$ 1.193.002 para el año 2025 y M$ 2.196.367 para el año 2026.\nSe rebaja para el año 2022 el monto de M$61.576 para el “HOSPITAL DE COQUIMBO” e incrementando el de “HOSPITALES GRUPO III: RED LOS RÍOS - LOS LAGOS” en M$27.385, en tanto que para ambos proyectos, aumentan los\nmontos de años futuros. \nen M$969.700 el año 2024, en M$1.031.742 el año 2025 y en M$266.171 el año 2026.',NULL,NULL,706,NULL,233,'2022-04-26','2022-06-02',NULL,NULL,'2022-06-02','Solo Excel',NULL,453953,'2022-12-30 23:53:26','DEC706DGC','http://dirplancolabora.mop.gov.cl/presu/Decretos/2022/DEC706DGC.pdf'),(746,529,'2022-11-03','Proposicion',2022,'se solicita autorización para realizar una Comisión de Servicio al Extranjero para, Inspector Fiscal, entre los días 6 al 14 de noviembre, relacionado con visitas de inspección técnica de fábricas y maestranzas que elaboran los sistemas de apoyo y sillas del Puente Chacao',NULL,NULL,706,NULL,NULL,NULL,NULL,'2022-11-02','0213',NULL,'Solo Excel',NULL,NULL,'2022-12-30 23:53:26','SOL706DV','http://dirplancolabora.mop.gov.cl/presu/Decretos/2022/SOL706DV.pdf'),(747,531,'2022-11-03','Proposicion',2022,'Vialidad solicita PROGRAMA REGULAR\nSolicita autorización para  Comisión de Servicio al  Extranjero para la Dirección  de Vialidad.\nEn conformidad a las normas de flexibilidad presupuestaria y al GAB. PRES 004 de 25.03.2022, en lo que respecta a viajes internacionales, se solicita autorización para realizar una Comisión de Servicio al Extranjero, relacionadas a un viaje del Sr. Carlo Castilla Rho,  Inspector Fiscal, entre los días 6 al 14 de noviembre, relacionado con visitas de inspección  técnica de fábricas y maestranzas que elaboran los sistemas de apoyo y sillas del Puente Chacao.\n1. Viaje a Italia: Visita de inspección técnica a Fábrica AFC, en dónde se están fabricando \nlas Sillas para el Cable Principal del Puente Chacao, en las ciudades de Údine y Vedelago, entre los días 06.11.2022 y 10.11.2022.\n2. Viaje a Alemania: Visita de inspección técnica a Fábrica MAURER, donde se fabricarán 3 de los 7 sistemas de apoyo y amortiguadores del Puente Chacao, en la ciudad de \nMünchen, entre los días 11.11.2022 y 14.11.2022.',NULL,NULL,706,NULL,NULL,NULL,NULL,'2022-11-03','0213',NULL,'Solo Excel',NULL,NULL,'2022-12-30 23:53:26','SOL706DV','http://dirplancolabora.mop.gov.cl/presu/Decretos/2022/SOL706DV.pdf'),(748,73,'2022-05-18','Decreto',2022,'Traspaso presupuestario que asigna recursos en el ST 22 FET “Bienes y Servicios de Consumo”, por el monto de M$61.596, del ST 30  Fondo de Emergencia Transitorio” (“FET”), los cuales no  fueron considerados en el Decreto N°45 de 18 de enero 2022, del Ministerio de Hacienda y cuyo financiamiento corresponde a estudios ST. 22.11.- Estudio Ferroviario apoyo a la revisión de los estudios requeridos para ejecutar una Concesión Ferroviaria.\n',NULL,NULL,707,NULL,268,'2022-04-28','2022-05-26',NULL,NULL,'2022-05-26','Solo Excel',NULL,54785,'2022-12-30 23:53:26','DEC707DGC_FETCovid19','http://dirplancolabora.mop.gov.cl/presu/Decretos/2022/DEC707DGC_FETCovid19.pdf'),(749,108,'2022-05-18','Decreto',2022,'Ajuste presupuestario que traspasa recursos desde el Subtítulo 30, Adquisición de Activos Financieros, hacia el ST 22 FET  “Bienes y Servicios de Consumo”, por un monto de M$104.979, para el desarrollo de un estudio que permitirá mejorar el diseño de los contratos de concesión, identificando condiciones que apunten a facilitar la certificación verde/so