d',2022,'Vialidad solicita ajuste presupuestario para el Subtítulo 24 “Transferencias Corrientes” de la Dirección de  Vialidad, con el fin cursar pagos a empresas concesionarias por concepto de devolución por sobrepeso.\nIncremento del ST 2401001 “Compensación Tránsito con Sobrepeso” por M$ 541.789.\nEn mayo del año 2021, para el proyecto de presupuesto del 2022, se estimó un monto de  M$ 930.958, que corresponde al gasto proyectado más ajustes, sin embargo, el monto  efectivo por concepto de devolución por sobrepeso es de M$ 1.472.746, lo cual da una  diferencia de M$ 541.789 respecto a los montos autorizados en la Ley de Presupuestos \nvigente. \nSe hace presente, que se encuentra disponible para su evaluación el financiamiento  declarado en el Ord. DCyF N° 548 del 17.08.2022. \n\nVialidad solicita ajuste presupuestario para el Subtítulo 24 “Transferencias Corrientes” de la Dirección de  Vialidad, con el fin cursar pagos a empresas concesionarias por concepto de devolución por sobrepeso.\nIncremento del ST 2401001 “Compensación Tránsito con Sobrepeso” por M$ 541.789.\nEn mayo del año 2021, para el proyecto de presupuesto del 2022, se estimó un monto de  M$ 930.958, que corresponde al gasto proyectado más ajustes, sin embargo, el monto  efectivo por concepto de devolución por sobrepeso es de M$ 1.472.746, lo cual da una  diferencia de M$ 541.789 respecto a los montos autorizados en la Ley de Presupuestos \nvigente. \nSe hace presente, que se encuentra disponible para su evaluación el financiamiento  declarado en el Ord. DCyF N° 548 del 17.08.2022. ',NULL,NULL,6928,NULL,NULL,NULL,NULL,'2022-07-15',NULL,NULL,'Solo Excel',NULL,NULL,'2022-12-30 23:53:26','OF6928DV','http://dirplancolabora.mop.gov.cl/presu/Decretos/2022/OF6928DV.pdf'),(1317,412,'2022-07-22','Oficio_Solicitud',2022,'Vialidad solicita de acuerdo a lo instruido en ORD. GAB.PRES. N°004 de fecha 25 de Marzo 2022 en su apartado XVIII, establece que las nuevas contrataciones celebradas \ndurante el segundo semestre del presente año, deberán ser autorizadas por la  Dirección de Presupuesto.\nDado lo antes mencionado, se adjunta listado de contrataciones para la  Dirección de Vialidad, de las cuales, su financiamiento se encuentra provisto en la Ley \nde Presupuesto.',NULL,NULL,7130,NULL,NULL,NULL,NULL,'2022-07-22',NULL,NULL,'Solo Excel',NULL,NULL,'2022-12-30 23:53:26','OF7130DV','http://dirplancolabora.mop.gov.cl/presu/Decretos/2022/OF7130DV.pdf'),(1318,386,'2022-08-25','Proposicion',2022,'Vialidad solicita ajuste presupuestario para el Subtítulo 24 “Transferencias Corrientes” de la Dirección de  Vialidad, con el fin cursar pagos a empresas concesionarias por concepto de devolución por sobrepeso.\nIncremento del ST 2401001 “Compensación Tránsito con Sobrepeso” por M$ 541.789.\nEn mayo del año 2021, para el proyecto de presupuesto del 2022, se estimó un monto de  M$ 930.958, que corresponde al gasto proyectado más ajustes, sin embargo, el monto  efectivo por concepto de devolución por sobrepeso es de M$ 1.472.746, lo cual da una  diferencia de M$ 541.789 respecto a los montos autorizados en la Ley de Presupuestos \nvigente. \nSe hace presente, que se encuentra disponible para su evaluación el financiamiento  declarado en el Ord. DCyF N° 548 del 17.08.2022. ',NULL,NULL,566,NULL,NULL,NULL,NULL,'2022-08-25','0213',NULL,'Solo Excel',NULL,NULL,'2022-12-30 23:53:26','SOL566DV','http://dirplancolabora.mop.gov.cl/presu/Decretos/2022/SOL566DV.pdf'),(1319,312,'2022-07-26','Oficio_Solicitud',2022,'Se solicita traspaso presupuestario provenientes de FSD ST. 31.02 por $M$9.998.646, los que seran destinados al ST. 29 adquisición de activos no financieros para dar cumplimiento a las condiciones necesarias que se requieren a nivel nacional, regional y provincial de la Dirección de Vialidad, dotando a los Laboratorios y Maestranzas de Vialidad de equipamiento suficiente para enfrentar adecuadamente el control de calidad de las obras viales que se ejecutan en todo el país. Así mismo permiti