),(1350,531,'2022-11-02','Oficio_Solicitud',2022,'Vialidad solicita PROGRAMA REGULAR\nSolicita autorización para  Comisión de Servicio al  Extranjero para la Dirección  de Vialidad.\nEn conformidad a las normas de flexibilidad presupuestaria y al GAB. PRES 004 de 25.03.2022, en lo que respecta a viajes internacionales, se solicita autorización para realizar una Comisión de Servicio al Extranjero, relacionadas a un viaje del Sr. Carlo Castilla Rho,  Inspector Fiscal, entre los días 6 al 14 de noviembre, relacionado con visitas de inspección  técnica de fábricas y maestranzas que elaboran los sistemas de apoyo y sillas del Puente Chacao.\n1. Viaje a Italia: Visita de inspección técnica a Fábrica AFC, en dónde se están fabricando \nlas Sillas para el Cable Principal del Puente Chacao, en las ciudades de Údine y Vedelago, entre los días 06.11.2022 y 10.11.2022.\n2. Viaje a Alemania: Visita de inspección técnica a Fábrica MAURER, donde se fabricarán 3 de los 7 sistemas de apoyo y amortiguadores del Puente Chacao, en la ciudad de \nMünchen, entre los días 11.11.2022 y 14.11.2022.',NULL,NULL,10399,NULL,NULL,NULL,NULL,'2022-11-02',NULL,NULL,'Solo Excel',NULL,NULL,'2022-12-30 23:53:26','OF10399DV','http://dirplancolabora.mop.gov.cl/presu/Decretos/2022/OF10399DV.pdf'),(1351,30,'2021-12-03','Oficio_Solicitud',2022,'El Servicio solicita en Cartera Regular, un presupuesto de MM$1.120.208.-para el año 2022, con una programación global para los próximos años de MM$938.014.-para el año 2023; MM$886.962.-para el año 2024; MM$510.831.-para el año 2025 y MM$81.999.-para el año 2026. \nEn cartera FET COVID habrá decretado un presupuesto de MM$571.448.-para el año 2022, con una programación global para los próximos años de MM$13.347.-para el año 2023; MM$25.-para el año 2024',NULL,'2021-12-28',11734,NULL,NULL,NULL,NULL,'2021-12-03',NULL,NULL,'Solo Excel',NULL,NULL,'2022-12-30 23:53:26','OF11734DV_FETCovid19','http://dirplancolabora.mop.gov.cl/presu/Decretos/2022/OF11734DV_FETCovid19.pdf'),(1352,29,'2021-12-29','Proposicion',2022,'Se solicita identificar 96 iniciativas por un monto total de M$568.117.022 destinado al financiamiento de contratos de arrastre de la cartera de inversión. En total, la propuesta compromete recursos futuros para el año 2023 de M$17.094.000, que corresponde al 3% del monto otorgado al Servicio en la Ley de Presupuestos 2022. El arrastre para el año 2024 es de M$25.000.-',NULL,NULL,865,NULL,NULL,NULL,NULL,'2021-12-30','0211',NULL,'Solo Excel',NULL,NULL,'2022-12-30 23:53:26','SOL865DV','http://dirplancolabora.mop.gov.cl/presu/Decretos/2022/SOL865DV.pdf'),(1353,30,'2021-12-29','Proposicion',2022,'Se solicita identificar 96 iniciativas por un monto total de M$568.117.022 destinado al financiamiento de contratos de arrastre de la cartera de inversión. En total, la propuesta compromete recursos futuros para el año 2023 de M$17.094.000, que corresponde al 3% del monto otorgado al Servicio en la Ley de Presupuestos 2022. El arrastre para el año 2024 es de M$25.000.-',NULL,NULL,865,NULL,NULL,NULL,NULL,'2021-12-30','0211',NULL,'Solo Excel',NULL,NULL,'2022-12-30 23:53:26','SOL865DV_FETCovid19','http://dirplancolabora.mop.gov.cl/presu/Decretos/2022/SOL865DV_FETCovid19.pdf'),(1354,33,'2021-12-30','Proposicion',2022,'Se solicita asignar recursos por M$ 400.500 para el año 2022, los que serán destinados a una iniciativa de inversión que ha sido priorizada por el Servicio. El proyecto “Construcción Costanera Sur San Pedro De La Paz” debe contratar servicios de consultoría para el diseño de ingeniería que permita la conexión vial por la ribera sur del río Biobío. Considerando la propuesta de identificación anterior, se comprometen recursos futuros para el año 2023 por M$910.642.870, que corresponde al 72% del monto otorgado al Servicio en la Ley de Presupuestos 2022. Los montos de arrastre para los años siguientes son M$ 850.517.400 para el año 2024, de M$ 497.838.000 para el año 2025 y M$ 81.999.000 para el año 2026.',1,NULL,881,NULL,NULL,NULL,NULL,'2021-12-31','0211',NULL,'Solo Excel',NULL,NULL,'2022-12-30 23:53:26','SOL881DV','http://dirplancolabora.mop.gov.cl/presu/Decretos/2022/SOL881DV.pdf'),(1355,29,'2021-12-29','Proposicion',2022,'Se solicita identificar 656 iniciativas por un monto total de M$1.088.918.237 destinado al financiamiento de contratos de arrastre y de contratos en los que se espera concretar procesos de licitación durante el presente año. En total, la propuesta compromete recursos futuros para el año 2023 por M$889.976.870, que corresponde al 70% del monto otorgado al Servicio en la Ley de Presupuestos 2022. Los montos de arrastre para los años siguientes son M$827.765.400 para el año 2024, M$488.838.000 para el año 2025 y\nM$78.932.000 para el año 2026.',NULL,NULL,866,NULL,NULL,NULL,NULL,'2021-12-29','0211',NULL,'Solo Excel',NULL,NULL,'2022-12-30 23:53:26','SOL866DV','http://dirplancolabora.mop.gov.cl/presu/Decretos/2022/SOL866DV.pdf'),(1356,29,'2021-12-30','Proposicion',2022,'Se solicita modificar 5 iniciativas asignando recursos por un monto total de M$7.073.000 destinado al financiamiento de cartera de contratos cuya licitación se espera concretar durante el presente año, para ser iniciados durante el primer semestre del año 2022. Considerando la propuesta de identificación anterior, se comprometen recursos futuros para el año 2023 por M$907.142.870, que corresponde al 72% del monto otorgado al Servicio en la Ley de Presupuestos 2022. Los montos de arrastre para los años\nsiguientes son M$849.767.400 para el año 2024, de M$497.838.000 para el año 2025 y M$81.999.000 para el año 2026.',NULL,NULL,872,NULL,NULL,NULL,NULL,'2021-12-30','0211',NULL,'Solo Excel',NULL,NULL,'2022-12-30 23:53:26','SOL872DV','http://dirplancolabora.mop.gov.cl/presu/Decretos/2022/SOL872DV.pdf'),(1357,29,'2022-02-16','Resolucion',2022,NULL,NULL,NULL,347,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Solo Excel',NULL,NULL,'2022-12-30 23:53:26',NULL,'http://dirplancolabora.mop.gov.cl/presu/Decretos/2022/.pdf'),(1358,4