1','Oficio_Solicitud',2022,'Solicita Decreto de Ajuste Presupuestario para el año 2022, correspondiente al traspaso desde el ST 30 Adquisición de Activos Financieros de la Dirección de Arquitectura, que asciende a M$2.609.768 y de la Dirección General de Concesiones que asciende a M$9.735.305, a diversos Programas con financiamiento FET-Covid-19, como también ajustes presupuestarios entre Programas FET-Covid-19. Esta solicitud incluye el traspaso del ST 30 al ST 21 Gasto en Personal, ST 22 Bienes y Servicios de Consumo y de forma parcial al ST 29 Adquisición de Activos no Financieros de diferentes Programas FET-Covid-19 según planilla adjunta y antecedentes de respaldo.\nPor otro lado, se rebajan M$10.203.036 del ST 31 de la Dirección de Obras Hidráulicas FET-Covid-19, los que permiten financiar el complemento de los requerimientos del ST 29 y los requerimientos del ST 31 de la Dirección General de Aguas FET-Covid-19 y de la Dirección de Aeropuertos FET-Covid-19, según propuesta adjunta y antecedentes de respaldo.',9,NULL,171,NULL,NULL,NULL,NULL,'2022-05-31',NULL,NULL,'Solo Excel',NULL,NULL,'2022-12-30 23:53:26','OF171MOP-MOP_FETCovid19','http://dirplancolabora.mop.gov.cl/presu/Decretos/2022/OF171MOP-MOP_FETCovid19.pdf'),(1462,246,'2022-05-31','Oficio_Solicitud',2022,'Solicita Decreto de Ajuste Presupuestario para el año 2022, correspondiente al traspaso desde el ST 30 Adquisición de Activos Financieros de la Dirección de Arquitectura, que asciende a M$2.609.768 y de la Dirección General de Concesiones que asciende a M$9.735.305, a diversos Programas con financiamiento FET-Covid-19, como también ajustes presupuestarios entre Programas FET-Covid-19. Esta solicitud incluye el traspaso del ST 30 al ST 21 Gasto en Personal, ST 22 Bienes y Servicios de Consumo y de forma parcial al ST 29 Adquisición de Activos no Financieros de diferentes Programas FET-Covid-19 según planilla adjunta y antecedentes de respaldo.\nPor otro lado, se rebajan M$10.203.036 del ST 31 de la Dire